import React, { useState ,useEffect} from "react";
import { Container, Row, Col, Card, CardHeader, CardBody, Form, FormGroup, Nav, NavItem, NavLink, FormInput, FormSelect, Button } from 'shards-react'
import PageTitle from "../components/common/PageTitle";
import { useTranslation } from "react-i18next";
import { Calendar, momentLocalizer } from "react-big-calendar";
import "react-big-calendar/lib/css/react-big-calendar.css";
import moment from "moment";
import "moment/locale/nb";
import api from "../api/api";
import Select from 'react-select';


const localizer = momentLocalizer(moment);

const MyCalendar = props => {
  const { t, i18n } = useTranslation();
  const [isLoading, setIsLoading] = useState(true)

  const [multipleOption,setMultipleOpt] = useState([])
  const [events, setEvents] = useState([]);
  const [allSimulations, setAllSimulations] = useState([])
  const [singleSimulation, setSingleSimulation] = useState([])
  const [simulationId, setSimulationId] = useState('')

  useEffect(() => {
      const getAllSimulations = async () => {
          try {
              await api.get('/simulation/get-simulations')
                  .then(result => {
                      let listSimulations = result.data.simulations
                      if (result.data.type === "success") {
                          setAllSimulations(listSimulations)
                      }
                  }).catch(err => {
                      console.log(err)
                  }).finally(() => setIsLoading(false))
          } catch (error) {

          }
      }
      getAllSimulations()
  }, [])


  const getSingleSimulation = (e) => {
    let Id = ''
    console.log(e)
   for (let i = 0; i < allSimulations.length; i++) {
    if(allSimulations.length > 0){
      if( typeof e[i] !== "undefined")
      Id=e[i].value

    }

   }
     setSimulationId(Id)
      let data = {
        simulation_id : Id
      }
      try {
        if(Id !== ''){
          api.post('/simulation/single-simulation',data)
          .then(result => {
            let simulation = result.data.Simulation
            if(result.data.type === "success"){
              setSingleSimulation(simulation.result)
            }
          }).catch(err=>{
              console.log(err)
          })

        }
      } catch (error) {
          console.log(error)
      }
  }
    useEffect(()=>{
     let data = [] 
     let irrig = singleSimulation.filter(simulation=>{

        return simulation.irrigationNbr === 1
      })
      if(irrig){
        irrig.map(irrigDay=>{
          data.push({
            title: 'Irrigation : '+parseFloat(irrigDay.irrigation).toFixed(2)+' m³',
            allDay: true,
            start: new Date(irrigDay.date),
            end: new Date(irrigDay.date)
          })
        })
        setEvents(data)
      }
    },[singleSimulation])


    useEffect(()=>{
      let options = []

    allSimulations.map(simulation=>{
      options.push({
        value : simulation.id,
        label :simulation.name

    })
    })
    setMultipleOpt(options)

    },[allSimulations])

  return (
    <Container fluid className="main-content-container p-4">
      <Row noGutters className="page-header py-4">
        <PageTitle
          sm="4"
          title={t('Irrigations schedule')}
          subtitle={t('overview')}
          className="text-sm-left"
        />
      </Row>
      <Row className="py-4 d-flex justify-content-center align-items-center">
        {/* <FormGroup className="text-center">
          <label  htmlFor="select">Select Name</label>
          <FormSelect id="select" value={simulationId}  onChange={handleSelect} >
            <option value="">Select Name</option>
            {
              allSimulations.map(simulation=>{
                return <option value={simulation.id}>{simulation.name}</option>
              })
            }
          </FormSelect>
        </FormGroup> */}
        <Col lg='4' md='8' sm='8'>
        <Select
        isMulti
        onChange={e=>getSingleSimulation(e)}
        options={multipleOption}
        />

        </Col>
      </Row>
      <Row>
        <Col lg='12' md='12' sm='12'>
          <Card>
            <CardBody>

              <div style={{ height: 590 }}>
                <Calendar
                  localizer={localizer}
                  culture="en-GB"
                  views={["month", "week"]}
                  events={events}
                  startAccessor="start"
                  endAccessor="end"
                  eventPropGetter={(event, start, end, isSelected) => ({
                    event,
                    start,
                    end,
                    isSelected,
                    style: { backgroundColor: "green" }
                  })}
                />
              </div>

            </CardBody>
          </Card>
        </Col>
      </Row>

    </Container>
  );
};

export default MyCalendar;
